import React from "react";
import * as userServices from "../../services/userServices";

class Friends extends React.Component {
  state = { friends: [{ title: "", summary: "", photoImage: "" }] };

  componentDidMount() {
    //let myFriends = Response.data.item.pagedItems;
    userServices.getFriends().then(this.onGetSuccess).catch(this.onGetError);
  }

  onGetSuccess = (myFriends) => {
    console.log(myFriends);
    this.setState((preState) => {
      return { mappedFriends: myFriends.map(this.mapFriend) };
    });
  };
  onGetError = (error) => {
    console.log(error);
  };
  mapFriend = (oneFriend) => {
    return (
      <React.Fragment key={`myFriends-${oneFriend.id}`}>
        <div className="card col-md-3">
          <img src={oneFriend.photoImage} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">{oneFriend.title}</h5>
            <p className="card-text">
              <strong>{oneFriend.summary}</strong>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <button className="btn btn-primary link-button">
              Go somewhere
            </button>
          </div>
        </div>
      </React.Fragment>
    );
  };
  // mapFriendSimple = (oneFriend) => {
  //   return <p key={`,myFriends-${oneFriend.id}`}>{oneFriend.title}</p>;
  // };
  render() {
    return (
      <div className="col-md-12 p-5">
        <h1>Friends</h1>
        <hr />
        <div className="row">{this.state.friends.map(this.mapFriend)}</div>
      </div>
    );
  }
}
export default Friends;
